import React, { Fragment } from "react";

// Import styles
import s from "../../../styles/profile.module.css";

// Import constants
import { FollowersData } from "../../../utils/constants";

const Followers = () => {
  return (
    <Fragment>
      <div className={s.FollowerContainer}>
        <div className={s.header}>
          <h1>You're Following (31)</h1>
          <div className={s.seeAll}>
            <p>
              see all
              <img
                src="../../../static/assets/images/right-arrow.png"
                className="img-fluid ml-1"
                width="14"
              />
            </p>
          </div>
        </div>
        <div className={s.FollowersMain}>
          <div className={s.FollowerImage}>
            <img
              src="../../../static/assets/images/picture-1.png"
              alt="img"
              className="img-fluid"
            />
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default Followers;
